import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'NeumericTable';
  number: number = 0;
  tableArray: number[] = [];

  generateTable() {
    this.tableArray = [];
    for(let i = 1; i <= 10; i++) {
      this.tableArray.push(i * this.number);
    }
  }
}
